// CardComponent.js
import React from 'react';
import './CardComponent.css';

const CardComponent = ({ firstChar, startChar, endChar, startNum, endNum }) => {
  const chars = [];
  for (let i = startChar.charCodeAt(0); i <= endChar.charCodeAt(0); i++) {
    if (/[a-zA-Z]/.test(String.fromCharCode(i))) {
      chars.push(String.fromCharCode(i));
    }
  }

  const combined = [];
  for (let char of chars) {
    for (let i = startNum; i <= endNum; i++) {
      combined.push({ char, number: i });
    }
  }

  return (
    <div className="cards-wrapper">
      {combined.map((item, index) => (
        <div className="card" key={index}>
          <div className="card-content">
            <div>{firstChar}{item.char}</div>
            <div className="number large">{String(item.number).slice(-4)}</div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default CardComponent;
